{
  "swagger" : "2.0",
  "info" : {
    "description" : "This is a private API for RoamHR Services.",
    "version" : "v1",
    "title" : "RoamHR Services",
    "termsOfService" : "https://www.roamhr.com",
    "contact" : {
      "name" : "Vaultz Inc.",
      "url" : "https://www.roamhr.com",
      "email" : "admin@roamhr.com"
    },
    "license" : {
      "name" : "Private",
      "url" : "https://www.RoamHR.com"
    }
  },
  "host" : "vaultzservicesomerset.vaultz.io",
  "basePath" : "/webresources",
  "tags" : [ {
    "name" : "BBVA"
  }, {
    "name" : "Bankhook"
  }, {
    "name" : "Checking"
  }, {
    "name" : "Credentials"
  }, {
    "name" : "Customer"
  }, {
    "name" : "DepositIncome"
  }, {
    "name" : "Dwolla"
  }, {
    "name" : "Envelope"
  }, {
    "name" : "Feed"
  }, {
    "name" : "Fiserv"
  }, {
    "name" : "Fusion"
  }, {
    "name" : "IncomeTax"
  }, {
    "name" : "Login"
  }, {
    "name" : "Mileage"
  }, {
    "name" : "Partner"
  }, {
    "name" : "Plaid"
  }, {
    "name" : "Rules"
  }, {
    "name" : "SNSResource"
  }, {
    "name" : "Savings"
  }, {
    "name" : "TaxWorksheet"
  }, {
    "name" : "Verify"
  } ],
  "schemes" : [ "https" ],
  "paths" : {
    "/BBVA/BBVACustomer" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "Creates a request for an approved BBVA customer ",
        "description" : "Takes a NewKey object with customer id and the customer's IP as the name parameter and creates request json dynamically from stored vaultz customer information",
        "operationId" : "RequestBBVACustomer",
        "consumes" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.NewKey",
          "description" : "customer info",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/NewKey"
          }
        } ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/BBVACustomer/Account" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "Opens an account for a confirmed BBVA Customer ",
        "description" : "Takes a customer id and validates most data on the back end to open the new account. Customer must be in approved status first.  In addition it also registers the bbva account for transfer as well.",
        "operationId" : "CreateBBVACustomerAccount",
        "consumes" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.NewKey",
          "description" : "customer info",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/NewKey"
          }
        } ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/BBVACustomer/Account/Block" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "Blocks a customers bbva account ",
        "description" : "Takes a customer id, block type and reason in NewKey_parm and Blocks the active bbva account.",
        "operationId" : "BlockBBVACustomerAccount",
        "consumes" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.NewKey_parm",
          "description" : "customer info",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/NewKey_parm"
          }
        } ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/BBVACustomer/Account/Block/Remove" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "Unblocks an account with block id passed ",
        "description" : "Takes a customer id and block id in the name filed of a newkey and removes the block.",
        "operationId" : "DeleteBBVACustomerAccountBlock",
        "consumes" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.NewKey",
          "description" : "customer info",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/NewKey"
          }
        } ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/BBVACustomer/Account/Blocks" : {
      "get" : {
        "tags" : [ "BBVA" ],
        "summary" : "Get Customer Account Blocks ",
        "description" : "Takes a customer id in a newkey and returns active account blocks.",
        "operationId" : "GetBBVACustomerAccountBlocks",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "name" : "customerid",
          "in" : "query",
          "description" : "customerid",
          "required" : true,
          "type" : "string"
        } ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/BBVACustomer/Account/Remove" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "Closes a customers bbva account ",
        "description" : "Takes a customer id and closes the active bbva account.",
        "operationId" : "DeleteBBVACustomerAccount",
        "consumes" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.NewKey",
          "description" : "customer info",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/NewKey"
          }
        } ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/BBVAWebhook/Listener" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "The endpoint for BBVA to post events to as webhook objects ",
        "description" : "This should take BBVA's webhook model, parse out the topics and process necessary events. Interested in funding_source_verified, customer_verification_document_needed, customer_verified and transactions processing for emails",
        "operationId" : "GetBBVAEvents",
        "consumes" : [ "application/json" ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/BBVAWebhook/Subscription" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "Creates a BBVA webhook subscription ",
        "description" : "Takes a bbva CreateWebhook object format to create a URL pointer for listening to bbva events. ",
        "operationId" : "SetBBVAWebhook",
        "consumes" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.BBVA.BBVAWebhookSubscribe",
          "description" : "webhook request",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/BBVAWebhookSubscribe"
          }
        } ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/BBVAWebhook/Subscriptions" : {
      "get" : {
        "tags" : [ "BBVA" ],
        "summary" : "Get all subscriptions",
        "description" : "Doesn't take a values at this point",
        "operationId" : "RequestBBVASubscriptions",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/NewKey"
            }
          }
        }
      }
    },
    "/BBVA/FundSandbox" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "Sandbox only fund source account for user.",
        "description" : "This is only available in the sandbox - adds 100 dollars to the customers account. Used to test transfers",
        "operationId" : "FundBbvaSandbox",
        "consumes" : [ "application/json" ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/FundingSource" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "After a bank account is connected by plaid this service initiates the request to BBVA for it to be a funding source.",
        "description" : "This service first takes a bank ref account previously provided by plaid as a NewKey (customerid, plaid_ref_account)  and creats an authorized request to make it a BBVA funding source.",
        "operationId" : "SetBBVAFundingSource",
        "consumes" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.NewKey",
          "description" : "customer and plaid ref",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/NewKey"
          }
        } ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/InternalFundingSource" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "When a customer creates a BBVA account, we need to add it as a transfer source for BBVA internally.",
        "description" : "This service alows us to seperately created that internal Transfer reference source for BBVA.  This is usually called as part of creating the account",
        "operationId" : "SetBBVAInternalFundingSource",
        "consumes" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.NewKey",
          "description" : "customer id as newkey value",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/NewKey"
          }
        } ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/BBVA/idv/image" : {
      "post" : {
        "tags" : [ "BBVA" ],
        "summary" : "Send idv image of document to bbva for validation ",
        "description" : "Takes a CustomerKYCDocImage and passes through to BBVA. ",
        "operationId" : "SendBBVAIdvImage",
        "consumes" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.CustomerKYCDocImage",
          "description" : "Customer image upload",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/CustomerKYCDocImage"
          }
        } ],
        "responses" : {
          "default" : {
            "description" : "successful operation"
          }
        }
      }
    },
    "/Bankhook" : {
      "post" : {
        "tags" : [ "Bankhook" ],
        "summary" : "Listen for a webhook post from Plaid",
        "description" : "The webhook invokes the transactions request from Plaid and then sorts out and persists deposits",
        "operationId" : "RecieveWebhook",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.PlaidTransWebhook",
          "description" : "inbound webhook",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/webhookTrans"
          }
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "type" : "integer",
              "format" : "int32"
            }
          }
        }
      }
    },
    "/Bankhook/Test" : {
      "post" : {
        "tags" : [ "Bankhook" ],
        "summary" : "Test for deposit processing",
        "description" : "There's no way to adequately predict when a webhook is coming so this service call will just force the creation of an unprocessed deposit",
        "operationId" : "RecieveDepositTest",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/NewKey"
            }
          }
        }
      }
    },
    "/Checking" : {
      "get" : {
        "tags" : [ "Checking" ],
        "summary" : "Returns customer active bank account",
        "description" : "Pass in the X-Auth-Token and customerid as query parameters",
        "operationId" : "GetCustomerBankAccount",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "name" : "customerid",
          "in" : "query",
          "description" : "customer's customerid",
          "required" : true,
          "type" : "string"
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/bankaccount"
            }
          }
        }
      }
    },
    "/Checking/Activate" : {
      "post" : {
        "tags" : [ "Checking" ],
        "summary" : "Activate an existing non active account",
        "description" : "Takes a NewKey object and X-Auth-Token in the header.  This service deactivates any active account first and then activates the account of the token passed",
        "operationId" : "ActivatePrimaryAccount",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.NewKey",
          "description" : "customerid and token",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/NewKey"
          }
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/NewKey"
            }
          }
        }
      }
    },
    "/Checking/Balance" : {
      "get" : {
        "tags" : [ "Checking" ],
        "summary" : "Returns customer bank Balance",
        "description" : "Balance takes the requested parameters both fusion and plaid use token , plaid uses refaccount and fusion uses item which is the consumerid",
        "operationId" : "GetCustomerBankBalance",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "name" : "customerid",
          "in" : "query",
          "description" : "customer's customerid",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "token",
          "in" : "query",
          "description" : "Access token or account id",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "item",
          "in" : "query",
          "description" : "item indication in this case consumer id",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "refaccount",
          "in" : "query",
          "description" : "Specific account Reference",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "name",
          "in" : "query",
          "description" : "name",
          "required" : true,
          "type" : "string"
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/MoneyVal"
            }
          }
        }
      }
    },
    "/Checking/Daily_Deposits" : {
      "get" : {
        "tags" : [ "Checking" ],
        "summary" : "Not in USE:Returns customer DAILY bank Deposits",
        "description" : "This would seldom be used as bank deposits are pushed by the webhook framework - this totals deposits too by default",
        "operationId" : "GetCustomerDailyBankDeposits",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "name" : "customerid",
          "in" : "query",
          "description" : "customer's customerid",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "token",
          "in" : "query",
          "description" : "Plaid's Access token",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "date",
          "in" : "query",
          "description" : "today's date",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "item",
          "in" : "query",
          "description" : "Plaid's item indication",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "refaccount",
          "in" : "query",
          "description" : "Plaid's Specific account Reference",
          "required" : true,
          "type" : "string"
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/MoneyVal"
            }
          }
        }
      }
    },
    "/Checking/Deposits" : {
      "get" : {
        "tags" : [ "Checking" ],
        "summary" : "Returns customers last list of Deposits",
        "description" : "This is used to return deposits in a range as a failsafe to webhook based deposits which come from BankAccountWebhooks resource.  The customer can choose to call this and view deposits within a given range.  Already processed deposits will not be returned.",
        "operationId" : "GetCustomerBankDeposits",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "name" : "customerid",
          "in" : "query",
          "description" : "customer's customerid",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "token",
          "in" : "query",
          "description" : "Plaid's Access token",
          "required" : false,
          "type" : "string"
        }, {
          "name" : "startdate",
          "in" : "query",
          "description" : "start date",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "enddate",
          "in" : "query",
          "description" : "today's date",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "item",
          "in" : "query",
          "description" : "Plaid's item indication",
          "required" : false,
          "type" : "string"
        }, {
          "name" : "refaccount",
          "in" : "query",
          "description" : "Specific account Reference",
          "required" : true,
          "type" : "string"
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/MoneyVal"
            }
          }
        }
      }
    },
    "/Checking/List" : {
      "get" : {
        "tags" : [ "Checking" ],
        "summary" : "Returns a list of all customer linked  bank account",
        "description" : "Pass in the X-Auth-Token and customerid as query parameters",
        "operationId" : "GetCustomerBankAccountList",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "name" : "customerid",
          "in" : "query",
          "description" : "customer's customerid",
          "required" : true,
          "type" : "string"
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/bankaccount"
            }
          }
        }
      }
    },
    "/Checking/Remove" : {
      "post" : {
        "tags" : [ "Checking" ],
        "summary" : "Completely Removes checking account from RoamHR",
        "description" : "Removes the  account  from a passed item_id. Removes all vendor linkages.  Does not remove customer data such as processed transactions from the account.  Use before linking a new checking account. item_id can be obtained from get Checking/ which returns the current active account",
        "operationId" : "DeleteActiveBankAccount",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.NewKey",
          "description" : "customerid,item_id",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/NewKey"
          }
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/BankInfo"
            }
          }
        }
      }
    },
    "/Checking/Routing" : {
      "get" : {
        "tags" : [ "Checking" ],
        "summary" : "Returns customer bank Routing number",
        "description" : "To get the id and routing, we must be authorized for the account calling plaid auth is the way...Migrating to plaid service bean",
        "operationId" : "GetCustomerBankRouting",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "name" : "customerid",
          "in" : "query",
          "description" : "customer's customerid",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "token",
          "in" : "query",
          "description" : "Plaid's Access token",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "item",
          "in" : "query",
          "description" : "Plaid's item indication",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "refaccount",
          "in" : "query",
          "description" : "Plaid's Specific account Reference",
          "required" : true,
          "type" : "string"
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/BankInfo"
            }
          }
        }
      }
    },
    "/Checking/Transactions" : {
      "get" : {
        "tags" : [ "Checking" ],
        "summary" : "Returns customers last list of transactions",
        "description" : "This is used to show transactions for expense tracking purposes .. Date format can look like this 2020-01-01T18:35:24.00Z",
        "operationId" : "GetCustomerBankTrans",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "name" : "customerid",
          "in" : "query",
          "description" : "customer's customerid",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "token",
          "in" : "query",
          "description" : "Plaid's Access token",
          "required" : false,
          "type" : "string"
        }, {
          "name" : "startdate",
          "in" : "query",
          "description" : "start date",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "enddate",
          "in" : "query",
          "description" : "today's date",
          "required" : true,
          "type" : "string"
        }, {
          "name" : "item",
          "in" : "query",
          "description" : "Plaid's item indication",
          "required" : false,
          "type" : "string"
        }, {
          "name" : "refaccount",
          "in" : "query",
          "description" : "Plaid's Specific account Reference",
          "required" : true,
          "type" : "string"
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
            "schema" : {
              "$ref" : "#/definitions/TransactionConverter"
            }
          }
        }
      }
    },
    "/Credentials" : {
      "post" : {
        "tags" : [ "Credentials" ],
        "summary" : "What this does is post a set of credentials for a new Customer",
        "description" : "The username and password are passed in as JSON and then persisted passing back the id of the new credential set",
        "operationId" : "postNewCustomerCreds",
        "consumes" : [ "application/json" ],
        "produces" : [ "application/json" ],
        "parameters" : [ {
          "in" : "body",
          "name" : "Models.Credential",
          "description" : "credentials",
          "required" : true,
          "schema" : {
            "$ref" : "#/definitions/Credential"
          }
        } ],
        "responses" : {
          "200" : {
            "description" : "successful operation",
